INSERT INTO `produit` (`id`, `secteur_id`, `sous_secteurs_id`, `fournisseur_id`, `fiche_technique_id`, `reference`, `description`, `pu`, `del`, `is_select`, `is_valid`, `created`, `videos`, `categorie_id`, `featured_image_id_id`, `titre`, `currency_id`, `date_validation`, `pays_id`, `slug`, `phone_vu`, `titre_lower`, `ville_id`) VALUES
(87, 61, 342, 2, NULL, 'Rayonnage conventionnel', 'Rayonnage conventionnel, ce type vous permet l\'accés directe à n\'importe quelle palette.', 0, 0, 0, 1, '2011-04-11 16:16:15', NULL, 33, NULL, 'Rayonnages charges lourdes', 11, '2011-04-11 16:16:15', 1, 'rayonnages-charges-lourdes', 0, '', 1),
(88, 4, 82, 2, NULL, 'Palettiseur', 'PALLETISEUR AUTOMATIQUE DE SACS D\'HAUTE PRODUCTION\r\nLes palettiseurs ILERPAL à couches à niveau d’entrée élevé et avec plateforme mobile sont conçus pour fournir le maximum d\'avantages pendant beaucoup d’années avec une maintenance minimale.\r\n\r\nLa série ILERPAL permet palettiser une large gamme de produits en plusieurs formats et aussi en différents niveaux de production. \r\n\r\nLa douceur de l\'opération élimine les démarrages et les arrêts brusques, élargissant ainsi la vie des parties mécanique', 0, 0, 0, 1, '2011-04-11 16:27:19', NULL, 42, NULL, 'Emballage et conditionnement', 11, '2011-04-11 16:27:19', 1, 'emballage-et-conditionnement', 0, '', 1),
(89, 11, 420, 2, NULL, 'SPEED', 'Speed WMS est un progiciel de gestion d’entrepôt (Warehouse Management System) permettant de rationaliser les processus de fonctionnement de l\'entrepôt. \r\nLe système permet de faire des gains de productivité sur des axes multiples. Le logiciel de gestion de stock devient un facteur de différenciation..', 0, 0, 0, 1, '2011-04-11 17:26:43', NULL, 557, NULL, 'WMS', 11, '2011-04-11 17:26:43', 1, 'wms', 0, '', 1),
(90, 11, 270, 2, NULL, 'Rayonnage conventionnel', 'Ce système a été conçu pour le stockage de charges palettisées et s\'adapte à toutes charges et hauteurs. Il offre de multiples applications : classique, mobile, accumulation, dynamique, desservis par transstockeurs, chariots bi et tridirectionnels, etc....', 0, 0, 0, 1, '2011-04-11 19:31:01', NULL, 33, 11, 'Rayonnages charges lourdes ', 11, '2011-04-11 19:31:01', 1, 'rayonnages-charges-lourdes-1', 0, 'rayonnages charges lourdes ', 1),
(91, 11, 270, 2, NULL, 'Rack Mob', 'Ces rayonnages mobiles se déplacent sur des rails et permettent ainsi de profiter au maximum de l\'espace disponible. Indépendamment de leur emplacement, ce système permet d\'accéder à l’ensemble des documents ou produits par un seul couloir de service. Un système modulaire et évolutif.', 0, 0, 0, 1, '2011-04-11 19:33:51', NULL, 34, 12, 'Rayonnages mobiles', 11, '2011-04-11 19:33:51', 1, 'rayonnages-mobiles', 0, 'rayonnages mobiles', 1),
(92, 11, 270, 2, NULL, 'SL 3000', 'Système modulaire, esthétique, universel, fonctionnel, résistant, garantissant une qualité et une sécurité d’utilisation optimales. Ses caractéristiques et sa conception lui permettent d’offrir tout une gamme d’alternatives pour bureaux, bibliothèques, musées, hôpitaux, établissements scolaires et autres institutions.', 0, 0, 0, 1, '2011-04-11 19:58:07', NULL, 31, NULL, 'Rayonnages charges légères', 11, '2011-04-11 19:58:07', 1, 'rayonnages-charges-legeres', 0, '', 1),
(93, 11, 270, 2, NULL, 'SL 3000', 'Système modulaire, esthétique, universel, fonctionnel, résistant, garantissant une qualité et une sécurité d’utilisation optimales. Ses caractéristiques et sa conception lui permettent d’offrir tout une gamme d’alternatives pour bureaux, bibliothèques, musées, hôpitaux, établissements scolaires et autres institutions.', 0, 0, 0, 1, '2011-04-11 19:59:52', NULL, 31, 10, 'Rayonnages charges légères ', 11, '2011-04-11 19:59:52', 1, 'rayonnages-charges-legeres-1', 0, 'rayonnages charges légères ', 1),
(94, 11, 270, 2, NULL, 'SL 3000', 'Système modulaire, esthétique, universel, fonctionnel, résistant, garantissant une qualité et une sécurité d’utilisation optimales. Ses caractéristiques et sa conception lui permettent d’offrir tout une gamme d’alternatives pour bureaux, bibliothèques, musées, hôpitaux, établissements scolaires et autres institutions.', 0, 0, 0, 1, '2011-04-11 20:01:25', NULL, 31, NULL, 'Rayonnages charges légères ', 11, '2011-04-11 20:01:25', 1, 'rayonnages-charges-legeres-2', 0, '', 1),
(95, 11, 270, 2, NULL, 'Dynamique', 'Ce système repose sur le principe de la gravité. Les palettes chargées au point le plus haut de la ligne descendent mécaniquement sur des rouleaux vers le point le plus bas. La vitesse est contrôlée par des rouleaux freineurs à chaque place palette. Système P.E.-P.S. : premier entré, premier sorti.', 0, 0, 0, 1, '2011-04-11 20:03:59', NULL, 35, 13, 'Stockage dynamique', 11, '2011-04-11 20:03:59', 1, 'stockage-dynamique', 0, 'stockage dynamique', 1),
(96, 11, 270, 2, NULL, 'Dynamique', 'Ce système repose sur le principe de la gravité. Les palettes chargées au point le plus haut de la ligne descendent mécaniquement sur des rouleaux vers le point le plus bas. La vitesse est contrôlée par des rouleaux freineurs à chaque place palette. Système P.E.-P.S. : premier entré, premier sorti.', 0, 0, 0, 1, '2011-04-11 20:05:45', NULL, 35, NULL, 'Stockage dynamique ', 11, '2011-04-11 20:05:45', 1, 'stockage-dynamique-1', 0, '', 1),
(97, 4, 82, 2, NULL, 'Banderoleuse', 'BANDEROLEUSE À PLATEAU TOURNANT \r\n•	Modules principaux:\r\n•	Table tournante : loge le système de découpe et de soudage du film. Le convoyeur à rouleaux est placé sur la table.\r\n•	Colonne verticale supportant la bobine de film. Incorpore l’armoire de commande et l’interface opérateur par écran tactile.', 0, 0, 0, 1, '2011-04-11 22:40:08', NULL, 42, NULL, 'Emballage et conditionnement ', 11, '2011-04-11 22:40:08', 1, 'emballage-et-conditionnement-1', 0, '', 1),
(98, 4, 421, 2, NULL, 'ILERBIG ', 'Station de remplissage de BIG BAGS, avec alimentation palette vide automatique.', 0, 0, 0, 1, '2011-04-27 18:07:56', NULL, 559, NULL, 'STATION DE REMPLISSAGE', 11, '2011-04-27 18:07:56', 1, 'station-de-remplissage', 0, '', 1),
(99, 4, 421, 2, NULL, 'ILERFIL ABG ABT', 'Les ensacheuses ILERFIL ABG/ABT sont conçues pour les industries nécessitant un ensachage précis et rapide, avec une installation compacte et un investissement réduit.\r\n\r\nLes différentes problématiques existant sur les lignes d\'ensachage industriel ont été prises en compte lors de la conception de nos machines.', 0, 0, 0, 1, '2011-04-27 18:15:04', NULL, 561, NULL, 'Ensachageuse', 11, '2011-04-27 18:15:04', 1, 'ensachageuse', 0, '', 1),
(100, 4, 421, 2, NULL, 'ILERFIL ABG ABSD', 'Ligne d’ensachage semi-automatique, idéale pour l’industrie agroalimentaire, la chimie fine ou toute application requérant un pesage de haute précision et un nettoyage aisé lors des changements de produits.', 0, 0, 0, 1, '2011-04-27 18:16:50', NULL, 561, NULL, 'Ensachageuse', 11, '2011-04-27 18:16:50', 1, 'ensachageuse-1', 0, '', 1),
(101, 4, 421, 2, NULL, 'ILERFIL ABG ABT', 'ENSACHEUSE POIDS BRUT POUR SACS DE GUEULE OUVERTE\r\nLes ensacheuses ILERFIL ABG/ABT sont conçues pour les industries nécessitant un ensachage précis et rapide, avec une installation compacte et un investissement réduit.', 0, 0, 0, 1, '2011-04-27 18:19:35', NULL, 561, NULL, 'Ensachageuse', 11, '2011-04-27 18:19:35', 1, 'ensachageuse-2', 0, '', 1),
(102, 4, 421, 2, NULL, 'ILERBAG V', 'ENSACHEUSE FFS VERTICALE POUR FILM PE\r\nSolution pour les industries à la recherche d’une fiabilité accrue, de polyvalence, d’un niveau d’automatisation élevé et d’autonomie pour les process d’ensachage, le tout assorti d’une baisse significative des coûts d’ensachage.', 0, 0, 0, 1, '2011-04-27 18:24:05', NULL, 561, NULL, 'Ensachageuse', 11, '2011-04-27 18:24:05', 1, 'ensachageuse-3', 0, '', 1),
(103, 4, 421, 2, NULL, 'ILERBAG H', 'ENSACHEUSE FFS HORIZONTALE À BOBINE TUBULAIRE\r\nSolution pour les industries à la recherche d’une fiabilité accrue, de polyvalence, d’un niveau d’automatisation élevé et d’autonomie pour les process d’ensachage, le tout assorti d’une baisse significative des coûts d’ensachage', 0, 0, 0, 1, '2011-04-27 18:26:30', NULL, 561, NULL, 'Ensachageuse', 11, '2011-04-27 18:26:30', 1, 'ensachageuse-4', 0, '', 1),
(104, 4, 421, 2, NULL, 'ROBOSAC 800', 'PALETTISEUR À NIVEAU D’ENTRÉE ÉLEVÉ AVEC GRAPPIN ROBOTISÉ\r\nLes palettiseurs ROBOSAC 800, à niveau d’entrée élevé avec grappin motorisé, sont conçus pour assurer un service optimal pendant de longues années et avec un entretien minimal.\r\nLes équipements de TMI permettent de palettiser une gamme étendue de produits dans plusieurs formats et à différents niveaux de production. Ils sont conçus pour assurer un service optimal pendant de longues années et avec un entretien minimal.\r\n\r\nLe fonctionnemen', 0, 0, 0, 1, '2011-04-27 18:29:36', NULL, 560, NULL, 'Paletiseur', 11, '2011-04-27 18:29:36', 1, 'paletiseur', 0, '', 1),
(105, 4, 421, 2, NULL, 'ROBOSAC P4', 'ROBOSAC P4 permet la palettisation d\'une large gamme de produits sous différents formats. Sa conception prévoit des configurations allant de la simple palettisation au sol à la ligne de palettisation entièrement automatisée. Design compact, optimisation de l’encombrement et retour rapide sur investissement. Précis, silencieux, robuste et sans entretien, le palettiseur ROBOSAC P4 est conçu pour assurer un service optimal pendant de longues années en milieu industriel.\r\nPour les industries qui req', 0, 0, 0, 1, '2011-04-27 18:32:20', NULL, 560, NULL, 'Paletiseur', 11, '2011-04-27 18:32:20', 1, 'paletiseur-1', 0, '', 1),
(106, 4, 421, 2, NULL, 'ROBOT PALLETISEUR', 'CARACTÉRISTIQUES\r\nCellules flexibles de palettisation au moyen de robots industriels. Polyvalent pour la palettisation de sacs, cartons, bidons et la manutention de palettes.\r\nPossibilité d\'assister à plusieurs stations de manipulation simultanément.\r\nDépôt des sacs par grappin de type central ou latéral selon le sac et les mosaïques à palettiser.\r\nAdaptabilité pour la manutention de différents types d’emballages.\r\nFlexibilité pour conduire diverses lignes d’emballages en formant plusieurs palet', 0, 0, 0, 1, '2011-04-27 18:37:24', NULL, 560, NULL, 'Paletiseur', 11, '2011-04-27 18:37:24', 1, 'paletiseur-2', 0, '', 1),
(107, 4, 421, 2, NULL, 'ILERPAL BRICKPAL', 'PALLETISEUR AUTOMATIQUE DE SACS D\'HAUTE PRODUCTION\r\nLes palettiseurs ILERPAL à couches à niveau d’entrée élevé et avec plateforme mobile sont conçus pour fournir le maximum d\'avantages pendant beaucoup d’années avec une maintenance minimale.\r\n\r\nLa série ILERPAL permet palettiser une large gamme de produits en plusieurs formats et aussi en différents niveaux de production. \r\n\r\nLa douceur de l\'opération élimine les démarrages et les arrêts brusques, élargissant ainsi la vie des parties mécaniques.', 0, 0, 0, 1, '2011-04-27 19:03:17', NULL, 560, NULL, 'Paletiseur', 11, '2011-04-27 19:03:17', 1, 'paletiseur-3', 0, '', 1);
